import React, { ReactElement } from 'react';
// Uncomment to use the mock api calls.
import * as api from '../mocks/api';
import { BasicTable } from './PatientTable';

const ListPatients = async (): Promise<ReactElement> => {
  const newData = await api.getPatients();

  return <BasicTable data={newData} />;
};

export default ListPatients;
